import ChatContainer from '../pages/chat/container'
import Setting from '../pages/setting'
import MailList from '../pages/mail-list'

export const Routers = [
    {
        path: '/',
        components: ChatContainer
    },
    {
        path: '/mail-list',
        components: MailList
    },
    {
        path: '/setting',
        components: Setting
    },
    {
        path: '/set-message',
        components: Setting
    },
    {
        path: '/set-page',
        components: Setting
    },
    {
        path: '/set-login',
        components: Setting
    },
    {
        path: '/set-about',
        components: Setting
    }
]
